# array - Rust

## Primitive Type [array](#)

1.0.0 Â·

Expand description

A fixed-size array, denoted `[T; N]`, for the element type, `T`, and the non-negative compile-time constant size, `N`.

There are two syntactic forms for creating an array:

-   A list with each element, i.e., `[x, y, z]`.

-   A repeat expression `[expr; N]` where `N` is how many times to repeat `expr` in the array. `expr` must either be:

    -   A value of a type implementing the [`Copy`](marker/trait.Copy.html "trait std::marker::Copy") trait
    -   A `const` value

Note that `[expr; 0]` is allowed, and produces an empty array. This will still evaluate `expr`, however, and immediately drop the resulting value, so be mindful of side effects.

Arrays of _any_ size implement the following traits if the element type allows it:

-   [`Copy`](marker/trait.Copy.html "trait std::marker::Copy")
-   [`Clone`](clone/trait.Clone.html "trait std::clone::Clone")
-   [`Debug`](fmt/trait.Debug.html "trait std::fmt::Debug")
-   [`IntoIterator`](iter/trait.IntoIterator.html "trait std::iter::IntoIterator") (implemented for `[T; N]`, `&[T; N]` and `&mut [T; N]`)
-   [`PartialEq`](cmp/trait.PartialEq.html "trait std::cmp::PartialEq"), [`PartialOrd`](cmp/trait.PartialOrd.html "trait std::cmp::PartialOrd"), [`Eq`](cmp/trait.Eq.html "trait std::cmp::Eq"), [`Ord`](cmp/trait.Ord.html "trait std::cmp::Ord")
-   [`Hash`](hash/trait.Hash.html "trait std::hash::Hash")
-   [`AsRef`](convert/trait.AsRef.html "trait std::convert::AsRef"), [`AsMut`](convert/trait.AsMut.html "trait std::convert::AsMut")
-   [`Borrow`](borrow/trait.Borrow.html "trait std::borrow::Borrow"), [`BorrowMut`](borrow/trait.BorrowMut.html "trait std::borrow::BorrowMut")

Arrays of sizes from 0 to 32 (inclusive) implement the [`Default`](default/trait.Default.html "trait std::default::Default") trait if the element type allows it. As a stopgap, trait implementations are statically generated up to size 32.

Arrays of sizes from 1 to 12 (inclusive) implement [`From<Tuple>`](convert/trait.From.html "trait std::convert::From"), where `Tuple` is a homogeneous [tuple](primitive.tuple.html "primitive tuple") of appropriate length.

Arrays coerce to [slices (`[T]`)](primitive.slice.html "primitive slice"), so a slice method may be called on an array. Indeed, this provides most of the API for working with arrays.

Slices have a dynamic size and do not coerce to arrays. Instead, use `slice.try_into().unwrap()` or `<ArrayType>::try_from(slice).unwrap()`.

Arrayâ€™s `try_from(slice)` implementations (and the corresponding `slice.try_into()` array implementations) succeed if the input slice length is the same as the result array length. They optimize especially well when the optimizer can easily determine the slice length, e.g. `<[u8; 4]>::try_from(&slice[4..8]).unwrap()`. Array implements [TryFrom](convert/trait.TryFrom.html "trait std::convert::TryFrom") returning:

-   `[T; N]` copies from the sliceâ€™s elements
-   `&[T; N]` references the original sliceâ€™s elements
-   `&mut [T; N]` references the original sliceâ€™s elements

You can move elements out of an array with a [slice pattern](about:blank/reference/patterns.html#slice-patterns). If you want one element, see [`mem::replace`](mem/fn.replace.html "fn std::mem::replace").

## [Â§](#examples)Examples

```
let mut array: [i32; 3] = [0; 3];

array[1] = 1;
array[2] = 2;

assert_eq!([1, 2], &array[1..]);

// This loop prints: 0 1 2
for x in array {
    print!("{x} ");
}
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0Afn+main()+%7B%0A++++let+mut+array:+%5Bi32;+3%5D+=+%5B0;+3%5D;%0A++++%0A++++array%5B1%5D+=+1;%0A++++array%5B2%5D+=+2;%0A++++%0A++++assert_eq!(%5B1,+2%5D,+%26array%5B1..%5D);%0A++++%0A++++//+This+loop+prints:+0+1+2%0A++++for+x+in+array+%7B%0A++++++++print!(%22%7Bx%7D+%22);%0A++++%7D%0A%7D&edition=2021)

You can also iterate over reference to the arrayâ€™s elements:

```
let array: [i32; 3] = [0; 3];

for x in &array { }
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0Afn+main()+%7B%0A++++let+array:+%5Bi32;+3%5D+=+%5B0;+3%5D;%0A++++%0A++++for+x+in+%26array+%7B+%7D%0A%7D&edition=2021)

You can use `<ArrayType>::try_from(slice)` or `slice.try_into()` to get an array from a slice:

```
let bytes: [u8; 3] = [1, 0, 2];
assert_eq!(1, u16::from_le_bytes(<[u8; 2]>::try_from(&bytes[0..2]).unwrap()));
assert_eq!(512, u16::from_le_bytes(bytes[1..3].try_into().unwrap()));
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0Afn+main()+%7B%0A++++let+bytes:+%5Bu8;+3%5D+=+%5B1,+0,+2%5D;%0A++++assert_eq!(1,+u16::from_le_bytes(%3C%5Bu8;+2%5D%3E::try_from(%26bytes%5B0..2%5D).unwrap()));%0A++++assert_eq!(512,+u16::from_le_bytes(bytes%5B1..3%5D.try_into().unwrap()));%0A%7D&edition=2021)

You can use a [slice pattern](about:blank/reference/patterns.html#slice-patterns) to move elements out of an array:

```
fn move_away(_: String) { /* Do interesting things. */ }

let [john, roa] = ["John".to_string(), "Roa".to_string()];
move_away(john);
move_away(roa);
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0Afn+main()+%7B%0A++++fn+move_away(_:+String)+%7B+/*+Do+interesting+things.+*/+%7D%0A++++%0A++++let+%5Bjohn,+roa%5D+=+%5B%22John%22.to_string(),+%22Roa%22.to_string()%5D;%0A++++move_away(john);%0A++++move_away(roa);%0A%7D&edition=2021)

Arrays can be created from homogeneous tuples of appropriate length:

```
let tuple: (u32, u32, u32) = (1, 2, 3);
let array: [u32; 3] = tuple.into();
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0Afn+main()+%7B%0A++++let+tuple:+(u32,+u32,+u32)+=+(1,+2,+3);%0A++++let+array:+%5Bu32;+3%5D+=+tuple.into();%0A%7D&edition=2021)

## [Â§](#editions)Editions

Prior to Rust 1.53, arrays did not implement [`IntoIterator`](iter/trait.IntoIterator.html "trait std::iter::IntoIterator") by value, so the method call `array.into_iter()` auto-referenced into a [slice iterator](about:blank/primitive.slice.html#method.iter "method slice::iter"). Right now, the old behavior is preserved in the 2015 and 2018 editions of Rust for compatibility, ignoring [`IntoIterator`](iter/trait.IntoIterator.html "trait std::iter::IntoIterator") by value. In the future, the behavior on the 2015 and 2018 edition might be made consistent to the behavior of later editions.

[â“˜](# "This example runs with edition 2018")

```
// Rust 2015 and 2018:

let array: [i32; 3] = [0; 3];

// This creates a slice iterator, producing references to each value.
for item in array.into_iter().enumerate() {
    let (i, x): (usize, &i32) = item;
    println!("array[{i}] = {x}");
}

// The `array_into_iter` lint suggests this change for future compatibility:
for item in array.iter().enumerate() {
    let (i, x): (usize, &i32) = item;
    println!("array[{i}] = {x}");
}

// You can explicitly iterate an array by value using `IntoIterator::into_iter`
for item in IntoIterator::into_iter(array).enumerate() {
    let (i, x): (usize, i32) = item;
    println!("array[{i}] = {x}");
}
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0A//+Rust+2015+and+2018:%0A%0A%23!%5Ballow(array_into_iter)%5D+//+override+our+%60deny(warnings)%60%0Afn+main()+%7B%0A++++let+array:+%5Bi32;+3%5D+=+%5B0;+3%5D;%0A++++%0A++++//+This+creates+a+slice+iterator,+producing+references+to+each+value.%0A++++for+item+in+array.into_iter().enumerate()+%7B%0A++++++++let+(i,+x):+(usize,+%26i32)+=+item;%0A++++++++println!(%22array%5B%7Bi%7D%5D+=+%7Bx%7D%22);%0A++++%7D%0A++++%0A++++//+The+%60array_into_iter%60+lint+suggests+this+change+for+future+compatibility:%0A++++for+item+in+array.iter().enumerate()+%7B%0A++++++++let+(i,+x):+(usize,+%26i32)+=+item;%0A++++++++println!(%22array%5B%7Bi%7D%5D+=+%7Bx%7D%22);%0A++++%7D%0A++++%0A++++//+You+can+explicitly+iterate+an+array+by+value+using+%60IntoIterator::into_iter%60%0A++++for+item+in+IntoIterator::into_iter(array).enumerate()+%7B%0A++++++++let+(i,+x):+(usize,+i32)+=+item;%0A++++++++println!(%22array%5B%7Bi%7D%5D+=+%7Bx%7D%22);%0A++++%7D%0A%7D&edition=2018)

Starting in the 2021 edition, `array.into_iter()` uses `IntoIterator` normally to iterate by value, and `iter()` should be used to iterate by reference like previous editions.

[â“˜](# "This example runs with edition 2021")

```
// Rust 2021:

let array: [i32; 3] = [0; 3];

// This iterates by reference:
for item in array.iter().enumerate() {
    let (i, x): (usize, &i32) = item;
    println!("array[{i}] = {x}");
}

// This iterates by value:
for item in array.into_iter().enumerate() {
    let (i, x): (usize, i32) = item;
    println!("array[{i}] = {x}");
}
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0A//+Rust+2021:%0A%0Afn+main()+%7B%0A++++let+array:+%5Bi32;+3%5D+=+%5B0;+3%5D;%0A++++%0A++++//+This+iterates+by+reference:%0A++++for+item+in+array.iter().enumerate()+%7B%0A++++++++let+(i,+x):+(usize,+%26i32)+=+item;%0A++++++++println!(%22array%5B%7Bi%7D%5D+=+%7Bx%7D%22);%0A++++%7D%0A++++%0A++++//+This+iterates+by+value:%0A++++for+item+in+array.into_iter().enumerate()+%7B%0A++++++++let+(i,+x):+(usize,+i32)+=+item;%0A++++++++println!(%22array%5B%7Bi%7D%5D+=+%7Bx%7D%22);%0A++++%7D%0A%7D&edition=2021)

Future language versions might start treating the `array.into_iter()` syntax on editions 2015 and 2018 the same as on edition 2021. So code using those older editions should still be written with this change in mind, to prevent breakage in the future. The safest way to accomplish this is to avoid the `into_iter` syntax on those editions. If an edition update is not viable/desired, there are multiple alternatives:

-   use `iter`, equivalent to the old behavior, creating references
-   use [`IntoIterator::into_iter`](about:blank/iter/trait.IntoIterator.html#tymethod.into_iter "method std::iter::IntoIterator::into_iter"), equivalent to the post-2021 behavior (Rust 1.53+)
-   replace `for ... in array.into_iter() {` with `for ... in array {`, equivalent to the post-2021 behavior (Rust 1.53+)

[â“˜](# "This example runs with edition 2018")

```
// Rust 2015 and 2018:

let array: [i32; 3] = [0; 3];

// This iterates by reference:
for item in array.iter() {
    let x: &i32 = item;
    println!("{x}");
}

// This iterates by value:
for item in IntoIterator::into_iter(array) {
    let x: i32 = item;
    println!("{x}");
}

// This iterates by value:
for item in array {
    let x: i32 = item;
    println!("{x}");
}

// IntoIter can also start a chain.
// This iterates by value:
for item in IntoIterator::into_iter(array).enumerate() {
    let (i, x): (usize, i32) = item;
    println!("array[{i}] = {x}");
}
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0A//+Rust+2015+and+2018:%0A%0Afn+main()+%7B%0A++++let+array:+%5Bi32;+3%5D+=+%5B0;+3%5D;%0A++++%0A++++//+This+iterates+by+reference:%0A++++for+item+in+array.iter()+%7B%0A++++++++let+x:+%26i32+=+item;%0A++++++++println!(%22%7Bx%7D%22);%0A++++%7D%0A++++%0A++++//+This+iterates+by+value:%0A++++for+item+in+IntoIterator::into_iter(array)+%7B%0A++++++++let+x:+i32+=+item;%0A++++++++println!(%22%7Bx%7D%22);%0A++++%7D%0A++++%0A++++//+This+iterates+by+value:%0A++++for+item+in+array+%7B%0A++++++++let+x:+i32+=+item;%0A++++++++println!(%22%7Bx%7D%22);%0A++++%7D%0A++++%0A++++//+IntoIter+can+also+start+a+chain.%0A++++//+This+iterates+by+value:%0A++++for+item+in+IntoIterator::into_iter(array).enumerate()+%7B%0A++++++++let+(i,+x):+(usize,+i32)+=+item;%0A++++++++println!(%22array%5B%7Bi%7D%5D+=+%7Bx%7D%22);%0A++++%7D%0A%7D&edition=2018)

