1.55.0 Â· [source](https://doc.rust-lang.org/1.80.0/src/core/array/mod.rs.html#498-500)

Returns an array of the same size as `self`, with function `f` applied to each element in order.

If you donâ€™t necessarily need a new fixed-size array, consider using [`Iterator::map`](about:blank/iter/trait.Iterator.html#method.map "method std::iter::Iterator::map") instead.

##### [Â§](#note-on-performance-and-stack-usage)Note on performance and stack usage

Unfortunately, usages of this method are currently not always optimized as well as they could be. This mainly concerns large arrays, as mapping over small arrays seem to be optimized just fine. Also note that in debug mode (i.e. without any optimizations), this method can use a lot of stack space (a few times the size of the array or more).

Therefore, in performance-critical code, try to avoid using this method on large arrays or check the emitted code. Also try to avoid chained maps (e.g. `arr.map(...).map(...)`).

In many cases, you can instead use [`Iterator::map`](about:blank/iter/trait.Iterator.html#method.map "method std::iter::Iterator::map") by calling `.iter()` or `.into_iter()` on your array. `[T; N]::map` is only necessary if you really need a new array of the same size as the result. Rustâ€™s lazy iterators tend to get optimized very well.

##### [Â§](#examples-2)Examples

```
let x = [1, 2, 3];
let y = x.map(|v| v + 1);
assert_eq!(y, [2, 3, 4]);

let x = [1, 2, 3];
let mut temp = 0;
let y = x.map(|v| { temp += 1; v * temp });
assert_eq!(y, [1, 4, 9]);

let x = ["Ferris", "Bueller's", "Day", "Off"];
let y = x.map(|v| v.len());
assert_eq!(y, [6, 9, 3, 3]);
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0Afn+main()+%7B%0A++++let+x+=+%5B1,+2,+3%5D;%0A++++let+y+=+x.map(%7Cv%7C+v+%2B+1);%0A++++assert_eq!(y,+%5B2,+3,+4%5D);%0A++++%0A++++let+x+=+%5B1,+2,+3%5D;%0A++++let+mut+temp+=+0;%0A++++let+y+=+x.map(%7Cv%7C+%7B+temp+%2B=+1;+v+*+temp+%7D);%0A++++assert_eq!(y,+%5B1,+4,+9%5D);%0A++++%0A++++let+x+=+%5B%22Ferris%22,+%22Bueller%27s%22,+%22Day%22,+%22Off%22%5D;%0A++++let+y+=+x.map(%7Cv%7C+v.len());%0A++++assert_eq!(y,+%5B6,+9,+3,+3%5D);%0A%7D&edition=2021)

