ðŸ”¬This is a nightly-only experimental API. (`array_try_map`Â [#79711](https://github.com/rust-lang/rust/issues/79711))

A fallible function `f` applied to each element on array `self` in order to return an array the same size as `self` or the first error encountered.

The return type of this function depends on the return type of the closure. If you return `Result<T, E>` from the closure, youâ€™ll get a `Result<[T; N], E>`. If you return `Option<T>` from the closure, youâ€™ll get an `Option<[T; N]>`.

##### [Â§](#examples-3)Examples

```
#![feature(array_try_map)]

let a = ["1", "2", "3"];
let b = a.try_map(|v| v.parse::<u32>()).unwrap().map(|v| v + 1);
assert_eq!(b, [2, 3, 4]);

let a = ["1", "2a", "3"];
let b = a.try_map(|v| v.parse::<u32>());
assert!(b.is_err());

use std::num::NonZero;

let z = [1, 2, 0, 3, 4];
assert_eq!(z.try_map(NonZero::new), None);

let a = [1, 2, 3];
let b = a.try_map(NonZero::new);
let c = b.map(|x| x.map(NonZero::get));
assert_eq!(c, Some(a));
```

