1.77.0 Â· [source](https://doc.rust-lang.org/1.80.0/src/core/array/mod.rs.html#584)

Borrows each element and returns an array of references with the same size as `self`.

##### [Â§](#example)Example

```
let floats = [3.1, 2.7, -1.0];
let float_refs: [&f64; 3] = floats.each_ref();
assert_eq!(float_refs, [&3.1, &2.7, &-1.0]);
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0Afn+main()+%7B%0A++++let+floats+=+%5B3.1,+2.7,+-1.0%5D;%0A++++let+float_refs:+%5B%26f64;+3%5D+=+floats.each_ref();%0A++++assert_eq!(float_refs,+%5B%263.1,+%262.7,+%26-1.0%5D);%0A%7D&edition=2021)

This method is particularly useful if combined with other methods, like [`map`](#method.map). This way, you can avoid moving the original array if its elements are not [`Copy`](marker/trait.Copy.html "trait std::marker::Copy").

```
let strings = ["Ferris".to_string(), "â™¥".to_string(), "Rust".to_string()];
let is_ascii = strings.each_ref().map(|s| s.is_ascii());
assert_eq!(is_ascii, [true, false, true]);

// We can still access the original array: it has not been moved.
assert_eq!(strings.len(), 3);
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0Afn+main()+%7B%0A++++let+strings+=+%5B%22Ferris%22.to_string(),+%22%E2%99%A5%22.to_string(),+%22Rust%22.to_string()%5D;%0A++++let+is_ascii+=+strings.each_ref().map(%7Cs%7C+s.is_ascii());%0A++++assert_eq!(is_ascii,+%5Btrue,+false,+true%5D);%0A++++%0A++++//+We+can+still+access+the+original+array:+it+has+not+been+moved.%0A++++assert_eq!(strings.len(),+3);%0A%7D&edition=2021)

1.77.0 Â· [source](https://doc.rust-lang.org/1.80.0/src/core/array/mod.rs.html#603)

Borrows each element mutably and returns an array of mutable references with the same size as `self`.

##### [Â§](#example-1)Example

```

let mut floats = [3.1, 2.7, -1.0];
let float_refs: [&mut f64; 3] = floats.each_mut();
*float_refs[0] = 0.0;
assert_eq!(float_refs, [&mut 0.0, &mut 2.7, &mut -1.0]);
