1.34.0 Â· [source](https://doc.rust-lang.org/1.80.0/src/core/array/mod.rs.html#251)[Â§](#impl-TryFrom%3C%26%5BT%5D%3E-for-%26%5BT;+N%5D)

Tries to create an array ref `&[T; N]` from a slice ref `&[T]`. Succeeds if `slice.len() == N`.

```
let bytes: [u8; 3] = [1, 0, 2];

let bytes_head: &[u8; 2] = <&[u8; 2]>::try_from(&bytes[0..2]).unwrap();
assert_eq!(1, u16::from_le_bytes(*bytes_head));

let bytes_tail: &[u8; 2] = bytes[1..3].try_into().unwrap();
assert_eq!(512, u16::from_le_bytes(*bytes_tail));
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0Afn+main()+%7B%0A++++let+bytes:+%5Bu8;+3%5D+=+%5B1,+0,+2%5D;%0A++++%0A++++let+bytes_head:+%26%5Bu8;+2%5D+=+%3C%26%5Bu8;+2%5D%3E::try_from(%26bytes%5B0..2%5D).unwrap();%0A++++assert_eq!(1,+u16::from_le_bytes(*bytes_head));%0A++++%0A++++let+bytes_tail:+%26%5Bu8;+2%5D+=+bytes%5B1..3%5D.try_into().unwrap();%0A++++assert_eq!(512,+u16::from_le_bytes(*bytes_tail));%0A%7D&edition=2021)

